INSERT INTO `blogs` VALUES (1,1,4,'Initial Blog','Initial Blog','save.jpg','<p>Sample Initial Blog</p>','<h3>Key Points</h3>\r\n\r\n<ul>\r\n	<li>These omnivorous birds can be found in the wetlands of just about every continent with the Arctic and South America being the sole exceptions.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Crane birds often have long graceful necks, large elongated bodies covered in light colored feathers, and heads covered by those of a more striking color.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>They can be pretty tall and are known to be able to reach heights of 5 feet and over.</li>\r\n</ul>\r\n\r\n<p>Tall magnificent birds with long legs and necks,&nbsp;<a href=\"https://a-z-animals.com/animals/crane/\">cranes</a>&nbsp;spend most of their lives near the shallow water of swamps, lakes, streams, and ponds to hunt for prey and construct their nests. There are 15 species of crane birds still living worldwide, all of which belong to the family of Gruidae. Their diet normally consists of&nbsp;<a href=\"https://a-z-animals.com/animals/insects/\">insects</a>,&nbsp;<a href=\"https://a-z-animals.com/animals/fish/\">fish</a>,&nbsp;<a href=\"https://a-z-animals.com/animals/rodents/\">rodents</a>, small&nbsp;<a href=\"https://a-z-animals.com/animals/reptiles/\">reptiles</a>&nbsp;and&nbsp;<a href=\"https://a-z-animals.com/animals/amphibians/\">amphibians</a>, vegetation, and even some cultivated plants. They will root around with their beaks in the shallow water or sand in search of small morsels to consume. Their diet is also accompanied by small pebbles and grits to help them grind up food in their stomach.</p>\r\n\r\n<p>One of the most interesting facts about crane birds is that they perform an elaborate courtship dance to attract a potential mate. Many of them pair up for multiple reproductive seasons and raise the young together. However, because their native wetlands are among the most threatened habitats in the world, cranes are also endangered with&nbsp;<a href=\"https://a-z-animals.com/blog/22-animal-species-declared-extinct/\">extinction</a>. This article will cover some basic facts about the identification and behavior of eight different types of crane birds from all around the world. Many of the species on this list have unusual appearances or some other interesting facts about them.</p>',0,1,'publish',0,'2022-12-19 12:25:02','2023-01-06 06:52:15',NULL);
