INSERT INTO `course_lessons` VALUES (1,4,'About Lesson','<p><strong>Overview</strong></p>\r\n\r\n<p>Academic writing is a formal writing used in Universities and by scholars.</p>\r\n\r\n<p><strong>Common types of Academic writing includes:</strong></p>\r\n\r\n<p>✓ Essays<br />\r\n✓ Technical reports<br />\r\n✓ Lab reports<br />\r\n✓ Research papers<br />\r\n✓ Annotated Bibliography<br />\r\n✓ Dissertation<br />\r\n✓ Abstract<br />\r\n✓ Textbook<br />\r\n✓ Thesis<br />\r\n✓ Literature reviews</p>\r\n\r\n<p><strong>Characteristics of Academic Writing</strong></p>\r\n\r\n<ol>\r\n	<li><strong>Concise.</strong>&nbsp;Information in an academic paper must have a lot of information delivered in a<br />\r\n	few words. In other words, an academic paper should be brief but with adequate<br />\r\n	information.<br />\r\n	<strong>2. Precise.</strong>&nbsp;Precise means accurate and exactness. In academic writing, the information<br />\r\n	written should be accurate. There is no room for rumors in academic writing. Everything<br />\r\n	in the paper must correct.<br />\r\n	<strong>3. Logical Structure.</strong>&nbsp;Academic writing follows a certain specific structure depending on the<br />\r\n	type. For example, most of the academic writing follows the basic structure which<br />\r\n	includes an introduction, body paragraphs, and a conclusion.<br />\r\n	4<strong>. Impersonal tone.</strong>&nbsp;No matter the topic of discussion that an academic writer is developing,<br />\r\n	the tone must be ethical and avoid emotional, filthy, and or biased language. This is because in academic writing the main audience is the instructor. An instructor deserves a respectful tone like any other senior and knowledgeable person.</li>\r\n</ol>','2023-01-19 19:06:48','3',NULL,'2023-01-19 18:06:48','2023-01-19 18:06:48'),(2,5,'Overview','<p><strong>Overview</strong></p>\r\n\r\n<p>Critical thinking is simply the ability to take a problem, analyze it, and make clear decisions. In other words, critical thinking is an organized as well as a mental process that human use to get an idea of how the world works. It involves coming up with various questions and coming up with informed decisions. In real life, critical thinking is essential. Being able to think critically in any career is a great Asset.</p>','2023-01-19 19:09:16','3',NULL,'2023-01-19 18:09:16','2023-01-19 18:09:16');
/*!40000 ALTER TABLE `course_lessons` ENABLE KEYS */;
UNLOCK TABLES;

